import React from "react";
import "./Chatting.css";
import NavTop from "./NavTop/NavTop";
import NavTop2 from "./NavTop/NavTop2";
import List from "./List/List";
// import Input from "./NavTop/Input";
import ChatRoom from "./ChatRoom/ChatRoom";

const Chatting = () => {
  return (
    <div className="chatting">
      <div className="containerd">
        <div className="row">
          <div className="col">
            <div className="row">
              <div className="col-lg-3 one">
                <NavTop />
              </div>
              <div className="col-lg two">
                <NavTop2 />
              </div>
            </div>
            <div className="row">
              <div className="col-lg-3 three">
                <List />
              </div>
              <div className="col-lg four"></div>
            </div>
            <div className="row">
              <div className="col-lg-3 five">
              </div>
              <div className="col-lg six"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Chatting;
